import React, {Component} from 'react'

class Bottom extends Component{
    render(){
        return(
            <div style={footerStyling} className="main-footer">
                <footer className="bottomContainer">
                    <h1>Support | Policys | Cookies | <img src="/test-static/stripe.png" alt="Failed to load"/></h1>
                </footer>
            </div>
        )
    }
}

const footerStyling = {
    background : "#fff"
}


export default Bottom;
